// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import "@openzeppelin/contracts/access/Ownable.sol";

contract SupplyChain is Ownable {
    enum Status {
        Created,
        InTransit,
        Delivered
    }

    struct Package {
        uint256 id;
        string description;
        address creator;
        address currentOwner;
        Status status;
    }

    uint256 private nextPackageId = 1; // Start package IDs from 1
    mapping(uint256 => Package) private packages;

    event PackageCreated(uint256 indexed id, string description, address indexed creator);
    event PackageTransferred(uint256 indexed id, address indexed from, address indexed to, Status status);
    event PackageDelivered(uint256 indexed id, address indexed owner);

    constructor() Ownable(msg.sender) {}

    function createPackage(string calldata description) external returns (uint256) {
        uint256 packageId = nextPackageId;
        packages[packageId] = Package({
            id: packageId,
            description: description,
            creator: msg.sender,
            currentOwner: msg.sender,
            status: Status.Created
        });

        nextPackageId += 1;

        emit PackageCreated(packageId, description, msg.sender);
        return packageId;
    }

    function transferOwnership(uint256 packageId, address newOwner) external {
        Package storage pkg = packages[packageId];
        require(packageId >= 1 && packageId < nextPackageId, "Package does not exist");
        require(msg.sender == pkg.currentOwner, "Only current owner can transfer");
        require(newOwner != address(0), "New owner cannot be zero address");

        address previousOwner = pkg.currentOwner;
        pkg.currentOwner = newOwner;
        pkg.status = Status.InTransit;

        emit PackageTransferred(packageId, previousOwner, newOwner, pkg.status);
    }

    function markAsDelivered(uint256 packageId) external {
        Package storage pkg = packages[packageId];
        require(packageId >= 1 && packageId < nextPackageId, "Package does not exist");
        require(msg.sender == pkg.currentOwner, "Only current owner can mark delivered");

        pkg.status = Status.Delivered;
        emit PackageDelivered(packageId, pkg.currentOwner);
    }

    function getPackageDetails(uint256 packageId)
        external
        view
        returns (
            uint256 id,
            string memory description,
            address creator,
            address currentOwner,
            Status status
        )
    {
        require(packageId >= 1 && packageId < nextPackageId, "Package does not exist");
        Package storage pkg = packages[packageId];
        return (pkg.id, pkg.description, pkg.creator, pkg.currentOwner, pkg.status);
    }
}

